// src/App.js
import React from 'react';
import './App.css';
import Box from './components/Box';
import VerticalDivider from './components/VerticalDivider';
import Button from './components/Button'; // Import the Button component

function App() {
  return (
    <div className="page">
      <Box id="box1" />
      <VerticalDivider />
      <Box id="box2" />
      <div id="box2-buttons">
        <Button imgSrc="img/3a.png" alt="Left" onClick={() => console.log('Left button clicked')} />
        <div className="button-text">SERCE SETTINGS</div>
        <Button imgSrc="img/3b.png" alt="Right" onClick={() => console.log('Right button clicked')} />
      </div>
    </div>
  );
}

export default App;
